column8:
商品名：食事と一緒に飲むサラダ カート缶 195g<br><br>
原材料：野菜（にんじん、トマト、赤ピーマン、赤じそ、ほうれん草、モロヘイヤ、ブロッコリー、レタス、セロリ、しょうが、紫キャベツ、よもぎ、チンゲンサイ、カリフラワー、クレソン、パセリ、かぼちゃ、アスパラガス、たまねぎ、ビート、だいこん、小松菜、紫いも、あしたば、はくさい、なす、グリーンピース、ごぼう）、レモン果汁<br><br>
栄養成分：(100gあたり) 45kcal、たんぱく質1.2g、脂質0g、糖質8.9g、食物繊維2.1g、ナトリウム18~82mg、カルシウム25mg、カリウム410mg、ビタミンK7μg、葉酸6~61μg、β-カロテン2400~11000μg、ショ糖2.9g、リコピン7.3mg <br><br>
賞味期限：4ヶ月以上<br><br>
商品仕様：1本で1/2日分以上の野菜195gを使用した野菜100%ジュースです。<br>
しっかりと繊維感が味わえる、食事に響かない甘くない飲み口が特徴です。<br>
いつもの食事にプラス一品! 味わいすっきりサラダ感覚の野菜ジュースです。<br><style type="text/css">


